function get_texture(name: string) {
	if (!(name in colormaps)) {
		throw new Error(`Colormap "${name}" not found.`);
	}

	const data = colormaps[name];
	const n_channels = 4;
	const n_values = data.length / n_channels;

	const texture = new DataTexture( data, n_values, 1 );
	texture.type = FloatType;
	texture.format = RGBAFormat;
	texture.needsUpdate = true;
	return texture;
}

